                    <div class='tn-atom' field='tn_text_1592046299149'   ><strong>               Допомога щодо усунення ризиків </strong><br><br>- Визначення пов'язаних осіб та ідентифікація контрольованих операцій <br>- Проведення аналізу цін на відповідність принципу «витягнутої руки» <br>- Підготовка та перевірка звіту про контрольовані операції<br>- Підготовка документації з трансфертного ціноутворення та обґрунтування відповідності контрольованих операцій принципу «витягнутої руки»<br>- Аналіз ринку та галузі діяльності компанії <br>- Вибір та обґрунтування методів трансфертного ціноутворення <br>- Проведення підготовки (оновлення) економічного дослідження («Benchmarking study») <br>- Формування інформації про ціни по контрольованим операціям з офіційних та альтернативних джерел<br>- Розроблення та впровадження політики з трансфертного ціноутворення <br>- Підготовка глобальної документації з трансфертного ціноутворення («Master file») та звіту в розрізі країн («Local file»).<br>- Локалізація до вимог законодавства України та переклад групових файлів з трансфертного ціноутворення (адаптація підготовлених на груповому рівні документацій з трансфертного ціноутворення («Local files»), економічних досліджень («Benchmarking study»))</div>
























