                    <div class='tn-atom' field='tn_text_1591964061904'   >1.  Опис контрольованої операції із зазначенням ланцюга постачання (створення вартості) продукції (робіт або послуг), включаючи фізичні характеристики, якість і репутацію на ринку, країну походження та виробника, наявність товарного знаку та іншу інформацію, пов'язану з якісними характеристиками продукції (робіт або послуг). <br>
                        <br>
                        2. Відомості про фактично проведені розрахунки у контрольованій операції
                        <br>
                        <br>
                        3. Чинники, які вплинули на формування та встановлення ціни, зокрема бізнес-стратегії сторін операції
                        <br></div>
























