                    <div class='tn-atom' field='tn_text_1591964061904'   >1. Суму отриманих доходів (прибутку) та/або суму понесених витрат (збитку) внаслідок здійснення контрольованої операції, рівень рентабельності. <br>
                        <br>
                        2. Обґрунтування вибору методу, який застосовано для визначення відповідності умов контрольованої операції принципу «витягнутої руки», фінансового показника.
                        <br>
                        <br>
                        3. обґрунтування вибору та інформація про зіставні операції (зіставних осіб) і джерела інформації, які використовувалися для аналізу. <br>
                        <br>
                        4. Розрахунок обґрунтування використання під час визначення діапазону рентабельності, інформації за декілька податкових періодів (років) та розрахунок середньозваженого значення показника рентабельності.  <br>
                        <br>
                        5. Опис та розрахунок проведених коригувань (
                        <em>у разі застосування</em>). <br>
                        <br>
                        6. Опис алгоритму розподілу витрат постачальника, понесених для здійснення таких операцій, які враховуються під час розрахунку показника рентабельності (економічне обґрунтування вибору алгоритму розподілу витрат, методика його застосування, а також фактичний розрахунок, здійснений відповідно до обраної методики). <br></div>
























                </div>


